import { NgModule } from '@angular/core';

import { SharedModule } from 'app/shared/shared.module';
import { ParameterComponent } from './parameter.component';
import { ParameterRoutingModule } from './route/parameter-routing.module';
import { ParameterService } from './service/parameter.service';
import { RoleService } from '../../admin/access-control/role/role.service';
import { GroupService } from '../../admin/access-control/group/group.service';

import { PanelModule } from 'primeng/panel';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { TableModule } from 'primeng/table';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { ButtonModule } from 'primeng/button';
import { ConfirmationService, MessageService } from 'primeng/api';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ToastModule } from 'primeng/toast';
import { TagModule } from 'primeng/tag';

@NgModule({
  imports: [SharedModule,
  ParameterRoutingModule,
  PanelModule,
  DropdownModule,
  FormsModule,
  ReactiveFormsModule,
  InputTextModule,
  MultiSelectModule,
  TableModule,
  ButtonModule,
  ConfirmPopupModule,
  ToastModule,
  TagModule],
  declarations: [ParameterComponent],
  providers: [ParameterService, ConfirmationService, RoleService, GroupService, MessageService]
})
export class ParameterModule {
}
